  \"2016-08-30T12:24:55.249258\",\n\t\"name\": \"cooperative-recovery-initiative-2016-increasing-populations-of-western-snowy-plovers-and-s\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Project goals include measurable improvement
  in the number of breeding pairs of snowy plovers at Leadbetter Point and enhance
  their reproductive success to achieve recovery criteria. We will also measurably
  improve the number of horned lark breeding territories at Leadbetter Point to prevent
  local extirpation of the Washington coast population. This will be accomplished
  through intensive habitat management of breeding and wintering habitats and reductions
  of disturbance stressors at Willapa NWR and Leadbetter Point State Park. Habitat
  restoration is anticipated to be on a scale where dynamic ecological processes can
  sustain the ecosystem in a natural state that requires limited future maintenance.\",\n\t\"license_title\":
